import Modal from "../../components/modal";
import AddVehicle from "../../components/formVehicle";

export default function VehicleAdd({ open, handleClose, onChange, addVehicle ,vehicleConditions ,identityNumber ,selectedIdentityNumber,selectedVehicleCondition}) {
  return (
    <Modal
      open={open}
      handleClose={handleClose}
      renderContent={
        <AddVehicle onChange={onChange} addVehicle={addVehicle} vehicleConditions={vehicleConditions} identityNumber={identityNumber} selectedIdentityNumber={selectedIdentityNumber} selectedVehicleCondition={s}/>
      }
      width="40%"
    />
  );
}
